import React from 'react';

// Define the Result interface
interface Result {
  bidDate: string;
  propertyName: string;
  propertyManagement: string;
  city: string;
  zipCode: string;
  frequency: string;
  areaSize: number;
  lotState: string;
  congestionFactor: string;
  discount: number;
  hourlyRate: number;
  jobTime: number;
  estimatedCost: number;
  totalBidAmount: number;
}

// Define the ResultsTableProps interface
interface ResultsTableProps {
  results: Result[];
}

const ResultsTable: React.FC<ResultsTableProps> = ({ results }) => {
  return (
    <div>
      {results.length === 0 ? (
        <p>No results available.</p>
      ) : (
        results.map((result, index) => (
          <table
            key={index}
            style={{
              width: '100%',
              marginBottom: '20px',
              borderCollapse: 'collapse',
              border: '1px solid #ddd',
            }}
          >
            <thead>
            <tr>
              <th
                colSpan={2}
                style={{
                  textAlign: 'left',
                  padding: '10px',
                  backgroundColor: '#f2f2f2',
                }}
              >
                Result {index + 1}
              </th>
            </tr>
            </thead>
            <tbody>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Date of Bid</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.bidDate}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Property Name</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.propertyName}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Property Management</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.propertyManagement}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>City</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.city}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Zip Code</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.zipCode}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Frequency</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.frequency}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Area Size (Acres)</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.areaSize.toFixed(2)}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>State of Lot</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.lotState}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Congestion Factor</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.congestionFactor}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Discount (%)</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.discount}%
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Hourly Rate ($)</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.hourlyRate.toFixed(2)}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Job Time (minutes)</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.jobTime}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Estimated Cost ($)</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.estimatedCost.toFixed(2)}
              </td>
            </tr>
            <tr>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                <strong>Total Bid Amount ($)</strong>
              </td>
              <td style={{ padding: '10px', border: '1px solid #ddd' }}>
                {result.totalBidAmount.toFixed(2)}
              </td>
            </tr>
            </tbody>
          </table>
        ))
      )}
    </div>
  );
};

export default ResultsTable;
